import keccak.Keccak1600;
import org.bouncycastle.util.encoders.Hex;
import org.junit.jupiter.api.Test;

import java.util.Arrays;
import java.util.List;

import static org.junit.jupiter.api.Assertions.*;

class Keccak1600Test {

    List<String> inputData = Arrays
            .asList("This is a test",
                    "",
                    "oioi im brit-ish",
                    "abc",
                    "",
                    "",
                    "x123!$$£*^(%)$$$$");

    List<String> validHashes = Arrays
            .asList("",
                    "",
                    "",
                    "",
                    "",
                    "",
                    "");

    @Test
    public void Keccak1600SpeedTest(){
        for (int i = 0; i < inputData.size(); i++) {
                //Given
                Keccak1600 keccak1600 = new Keccak1600(inputData.get(i));

                //When
                byte[] out = keccak1600.digestArray();

                //Then
                assertEquals(validHashes.get(i),new String(Hex.encode(out)));
        }
    }
}